import React from "react";

export default function Contact() {
    return (
        <div className="Contact-Page">
            <div className="Contact-Container">
            <script src="https://kit.fontawesome.com/b5bff501df.js"></script>

            <i class="fas fa-envelope-square"></i>
                <div className="Contact">Email: JackBPainter@gmail.com</div>
                <div className="Contact">Telephone: 07704 706668</div>
                <div className="Contact">LinkedIn: https://www.linkedin.com/in/painterjack/</div>
            </div>
        </div>
    )
}
